import axios from "axios";
import {useEffect, useState} from "react";

function Datafetch2(){
    const [data, setData] = useState([]);
 
    useEffect(() => {
        const fetchMyData = async () => {
            const response = await axios.get('https://fakestoreapi.com/users');
            console.log(response);
            const responseData = await response.data;
            setData(responseData);
            console.log(responseData.data);
        }
        fetchMyData();
    }, [])
  
    return (
        <div>
            <h1>Data Fetching</h1>
            <table style={{border:"1px solid black"}}>
            <thead>
            <tr>
                <th scope="col" colSpan={6}>ADDRESS</th>
                <th scope="col" rowSpan={3}>ID</th>
                <th scope="col" rowSpan={3}>EMAIL</th>
                <th scope="col" rowSpan={3}>USERNAME</th>
                <th scope="col" rowSpan={3}>PASSWORD</th>
                <th scope="col" colSpan={2}>NAME</th>
                <th scope="col" rowSpan={3}>PHONE</th>
                <th scope="col" rowSpan={3}>V</th>
            </tr>
            
            <tr>
                        <th scope="col" colSpan={2}>Geolocation</th>
                        <th scope="col">City</th>
                        <th scope="col">street</th>
                        <th scope="col">Number</th>
                        <th scope="col">zipcode</th>
                        <th scope="col">Firstname</th>
                        <th scope="col">Lastname</th>

            </tr>
            <tr>
                <th scope="col">Lat</th>
                <th scope="col">Long</th>
            </tr>
            </thead>
            <tbody>
                {data.map((dataItem,index) =>
                        <tr>
                            <td>{dataItem.address.geolocation.lat}</td>
                            <td>{dataItem.address.geolocation.long}</td>
                            <td>{dataItem.address.city}</td>
                            <td>{dataItem.address.street}</td>
                            <td>{dataItem.address.number}</td>
                            <td>{dataItem.address.zipcode}</td>
                            <td>{dataItem.id}</td>
                            <td>{dataItem.email}</td>
                            <td>{dataItem.username}</td>
                            <td>{dataItem.password}</td>
                            <td>{dataItem.name.firstname}</td>
                            <td>{dataItem.name.lastname}</td>
                            <td>{dataItem.phone}</td>
                            <td>{dataItem.__v}</td>
                        </tr>
                )}
            </tbody>
            </table>
        </div>
    );

}

export default Datafetch2;
